import React from "react";
import Transaction from "../transaction/Transaction";

const TransactionsList = ({ transactions }) => {
  return (
    <div>
      <div></div>
      {!Array.isArray(transactions) && <Transaction />}
    </div>
  );
};

export default TransactionsList;
